import { Link } from "react-router-dom";
const Merchantnavbar = () => {
    return ( 
        <nav>
            <div className="logo">
                <h1>Shoppercart</h1>
            </div>
            <div className="option">
                <Link to="/productview">View product</Link>
            </div>
        </nav>
     );
}
 
export default Merchantnavbar;
